-- Table: public.BookTypes

-- DROP TABLE IF EXISTS public."BookTypes";

CREATE TABLE IF NOT EXISTS public."BookTypes"
(
    "BookTypeId" integer NOT NULL,
    "BookTypeCode" character varying(12) COLLATE pg_catalog."default" NOT NULL,
    "BookTypeName" character varying(50) COLLATE pg_catalog."default" NOT NULL,
    "Description" character varying(100) COLLATE pg_catalog."default",
    CONSTRAINT "BookTypes_pkey" PRIMARY KEY ("BookTypeId"),
    CONSTRAINT "Unique_Academics_BookTypes_BookTypeCode" UNIQUE ("BookTypeCode"),
    CONSTRAINT "Unique_Academics_BookTypes_BookTypeName" UNIQUE ("BookTypeName")
)

TABLESPACE pg_default;

ALTER TABLE IF EXISTS public."BookTypes"
    OWNER to gooddata;


-- Table: public.Books

-- DROP TABLE IF EXISTS public."Books";

CREATE TABLE IF NOT EXISTS public."Books"
(
    "BookId" integer NOT NULL,
    "BookName" character varying(100) COLLATE pg_catalog."default" NOT NULL,
    "SubjectId" integer NOT NULL,
    "ISBN" bigint,
    "Author" character varying(100) COLLATE pg_catalog."default",
    CONSTRAINT "Books_pkey" PRIMARY KEY ("BookId"),
    CONSTRAINT "Unique_Academics_Books_BookName" UNIQUE ("BookName"),
    CONSTRAINT "Unique_Academics_Books_ISBN" UNIQUE ("ISBN"),
    CONSTRAINT "Check_Academics_Books_ISBN" CHECK ("ISBN" IS NULL OR "ISBN" <= '9999999999999'::bigint)
)

TABLESPACE pg_default;

ALTER TABLE IF EXISTS public."Books"
    OWNER to gooddata;


-- Table: public.Users

-- DROP TABLE IF EXISTS public."Users";

CREATE TABLE IF NOT EXISTS public."Users"
(
    "UserId" integer NOT NULL,
    "UserName" character varying(50) COLLATE pg_catalog."default",
    "Department" character varying(50) COLLATE pg_catalog."default",
    CONSTRAINT "Users_pkey" PRIMARY KEY ("UserId"),
    CONSTRAINT "Unique_User_UserName" UNIQUE ("UserName")
)

TABLESPACE pg_default;

ALTER TABLE IF EXISTS public."Users"
    OWNER to gooddata;


-- Table: public.Sales

-- DROP TABLE IF EXISTS public."Sales";

CREATE TABLE IF NOT EXISTS public."Sales"
(
    "SaleId" integer NOT NULL,
    "BookId" integer NOT NULL,
    "BookTypeId" integer NOT NULL,
    "UserId" integer NOT NULL,
    "Value" double precision NOT NULL,
    "EntryDateTime" timestamp without time zone NOT NULL DEFAULT now(),
    CONSTRAINT "Sales_BookId_fkey" FOREIGN KEY ("BookId")
        REFERENCES public."Books" ("BookId") MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION,
    CONSTRAINT "Sales_BookTypeId_fkey" FOREIGN KEY ("BookTypeId")
        REFERENCES public."BookTypes" ("BookTypeId") MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION,
    CONSTRAINT "Sales_UserId_fkey" FOREIGN KEY ("UserId")
        REFERENCES public."Users" ("UserId") MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
)

TABLESPACE pg_default;

ALTER TABLE IF EXISTS public."Sales"
    OWNER to gooddata;




